const Middle = () => {
    return (
      <div style={{padding:"1%", borderRadius:"12px", boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)', backgroundColor:"#FAFAFA ", height:"96vh", width:"100%", textAlign: 'center', backdropFilter: 'blur(8px)',margin:"1vh"}}>
        Insurio
        <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
  {/* Chat Input Section */}
  <div style={{ display: 'flex', marginBottom: '20px' }}>
    <input
      type="text"
      placeholder="Ask about any coverage"
      style={{
        flex: 1,
        padding: '10px',
        borderRadius: '8px',
        border: '1px solid #ccc',
        marginRight: '10px',
        fontSize: '16px',
      }}
    />
    <button
      style={{
        padding: '10px 16px',
        borderRadius: '8px',
        backgroundColor: '#4CAF50',
        color: 'white',
        border: 'none',
        cursor: 'pointer',
        fontSize: '16px',
      }}
    >
      Send
    </button>
  </div>

  {/* Clickable Options */}
  <div style={{ display: 'flex', gap: '12px' }}>
    {['Search', 'Compare', 'Cost Estimate'].map((label) => (
      <div
        key={label}
        onClick={() => alert(`${label} clicked`)}
        style={{
          flex: 1,
          textAlign: 'center',
          padding: '12px',
          borderRadius: '10px',
          backgroundColor: '#f0f0f0',
          cursor: 'pointer',
          transition: 'background 0.3s',
        }}
      >
        {label}
      </div>
    ))}
  </div>
</div>

      </div>
    );
  };

  export default Middle;
